import React from "react";
import styled from "@emotion/styled/macro";
import { SongRow } from "./SongList/SongRow";
import { SongTableHeader } from "./SongList/SongTableHeader";
import { useSongList } from "contexts/songStats";

export default function SongTable() {
  const { sortedData, plansLoading } = useSongList();

  return (
    <DataTable className="data-table">
      <SongTableHeader />

      {plansLoading && <Loading />}
      <div id="songBody" className="data-content list">
        {sortedData.map((d) => (
          <SongRow key={d.id} song={d} />
        ))}
      </div>
    </DataTable>
  );
}

/////////////////////////////////////////////////////////////
function Loading() {
  return (
    <LoadingContainer>
      <span>Loading songs</span>
      <LoadingImage />
    </LoadingContainer>
  );
}

/////////////////////////////////////////////////////////////

const DataTable = styled.div`
  width: 100%;

  @media (min-width: 800px) {
    display: table;
    table-layout: fixed;
  }

  .drop-list {
    display: block;
    border-bottom: 5px solid #f2674f !important;
    margin-top: 0.25em;

    .no-sort {
      display: none;
    }

    @media (min-width: 800px) {
      display: none;
    }
  }

  .data-content {
    clear: both;
    display: block;

    @media (min-width: 800px) {
      display: table-row-group;
    }

    .data-row {
      padding: 0.5em 0.5em 1.5em;
      &:nth-child(even) {
        background: #eee;
      }

      @media (min-width: 800px) {
        padding: 0;
        display: table-row;
      }
    }
  }
`;

const LoadingContainer = styled.div`
  display: flex;
  span {
    line-height: 3em;
    vertical-align: top;
    font-size: 126%;
    margin-left: 1em;
  }

  @media (min-width: 800px) {
    min-width: 600px;
  }
`;

const LoadingImage = styled.span`
  width: 4em;
  height: 3em;
  display: inline-block;

  background-position: 0;
  background-repeat: no-repeat;
  background-size: cover;
  background-image: url("data:image/gif;base64,");
`;
